import React, {useState} from 'react';
import {Form, Button} from 'react-bootstrap';
import Axios from 'axios';


export const Cow = () => {

  const [animalID, setAnimalID] = useState('');
  const [staffID, setStaffID] = useState('');
  const [color,setColor] = useState('');
  const [age, setAge] = useState('');
  const [breed, setBreed] = useState(''); 
  const [sex, setSex] = useState('');
  const [fathersID, setFathersID] = useState('');
  const [mothersID, setMothersID] = useState('');
  const [birthDate, setBirthDate] = useState('');
  const [height, setHeight] = useState('');
  const [weight, setWeight] = useState('');
  const [milk, setMilk] = useState('');
  const [income, setIncome] = useState('');



  const register = (event) => {
    event.preventDefault()
    Axios.post('http://localhost:3001/register', {
      // username: usernameReg,
      // password: passwordReg,
      // first_name: firstnameReg,
      // last_name: lastnameReg,
      // email: emailReg,

      animalID: setanimalID,
      staffID: setStaffID,
      color: setColor,
      age:  setAge,
      breed: setBreed,
      sex: setSex,
      fathersID: setFathersID,
      mothersID: setMothersID,
      birthDate: setBirthDate,
      height: setHeight,
      weight: setWeight,
      milk: setMilk,
      income: setIncome, 

    }).then((response)=>{
      console.log(response);
    })
  }


  return (
    <div>
      <Form onClick={register}>
            <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>ID</Form.Label>
                <Form.Control type="number" placeholder="Enter First Name" onChange={(e)=> {setanimalID(e.target.value);
                }}/>


                <Form.Label>Staff ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Color</Form.Label>
                <Form.Control type="text" placeholder="Enter email"/>

                <Form.Label>Age</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Breed Name</Form.Label>
                <Form.Control type="text" placeholder="Enter Last Name"/>

                <Form.Label>Sex</Form.Label>
                <Form.Control type="text" placeholder="Enter Last Name"/>

                <Form.Label>Father's ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Mother's ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Date Of Birth</Form.Label>
                <Form.Control type="date" placeholder="Enter email"/>

                <Form.Label>Current Height</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Current Weight</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Total Milk</Form.Label>
                <Form.Control type="text" placeholder="Enter email"/>

                <Form.Label>Total Income</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>


            </Form.Group>
            <Button variant="primary" type="submit">
                Submit
            </Button>
        </Form>
    </div>
  )
}


export default Cow;
